import { Component } from '@angular/core';
import {FormControl, FormGroup} from '@angular/forms';
import {HttpClient} from "@angular/common/http";
import {UserplanService} from "../services/userplan.service";

@Component({
  selector: 'app-create-plan',
  templateUrl: './create-plan.component.html',
  styleUrls: ['./create-plan.component.scss']
})
export class CreatePlanComponent {
  plans = new FormGroup({
    amount: new FormControl(),
    sms: new FormControl(),
    appel: new FormControl(),
    data: new FormControl(),
    validity: new FormControl()
  });
  Hemle !:any;
  Mango !:any;
  constructor(private userplan : UserplanService) {
  }
  choiseplan(){
      let result={amount:this.plans.value.amount,sms:parseInt(<string>this.plans.value.sms) ,call:parseInt(<string>this.plans.value.appel),data:parseInt(<string>this.plans.value.data),validity:parseInt(<string>this.plans.value.validity)}
      console.log(result);

    if (result.sms==1 && result.call==1 && result.data==1){
       alert("on entre 1 priorite au plus deux fois")
      this.plans.reset();
     }
    if (result.sms==0 && result.call==0 && result.data==0){
      alert("on entre pas tout zero")
      this.plans.reset();
    }
    if(result.sms==1){
      if((result.call==1 && result.data==0) || (result.call==0 && result.data==1)){
        alert("on entre 1 au plus une fois ")
        this.plans.reset();
      }
    }
    if(result.call==1){
      if((result.sms==1 && result.data==0) || (result.sms==0 && result.data==1)){
        alert("on entre 1 au plus une fois ")
        this.plans.reset();
      }
    }
    if(result.data==1){
      if((result.sms==1 && result.call==0) || (result.sms==0 && result.call==1)){
        alert("on entre 1 au plus une fois ")
        this.plans.reset();
      }
    }
    this.userplan.showPlan(JSON.stringify(result)).subscribe(
      (response: any) => {
        if(response=="Hemle"){
          this.Hemle=response;
        }
        console.log(this.Hemle)
      }
    );
  }
}
<div class="container-xxl">
  <div class="authentication-wrapper authentication-basic container-p-y">
    <div class="authentication-inner">
      <!-- Register -->
      <div class="card xxl">
        <div class="card-body">
          <!-- Content info -->
          <h2 class="mb-2 text-center">Best-Plan </h2>
          <p class="mb-4 text-center">Salut, entre les informations pour avoir le fordait Ideal 😉 </p>

          <form  [formGroup]="plans" (ngSubmit)="choiseplan()" id="formAuthentication" class="mb-3" action="index.html" method="POST">
            <div class="d-custom">
              <div class="f-custom mb-3">
                <label for="email" class="form-label">Montant</label>
                <input
                  type="number"
                  class="form-control"
                  #email
                  placeholder="Enter your amount"
                  autofocus
                  formControlName="amount"
                />
              </div>
              <div class="mb-3 ">
                <div class="d-flex justify-content-between">
                  <label class="form-label" for="duree">Durée du forfait en jours </label>
                </div>
                <select class="form-select" id="exampleFormControlSelect1" aria-label="Default select example"  formControlName="validity">
                  <option selected>Selectionner le nombre jours</option>
                  <option value=1 >1</option>
                  <option value=7>7</option>
                  <option value=30>30</option>
                </select>
              </div>
            </div>

            <div class="mb-3">
              <label for="priorite1" class="form-label">Priorité sur les SMS</label>
              <select class="form-select" id="priorite1" aria-label="Default select example" formControlName="sms">
                <option selected>Selectionner la priorité</option>
                <option value=0>0</option>
                <option value=1>1</option>
                <option value=2>2</option>
                <option value=3>3</option>
              </select>
            </div>
            <div class="mb-3">
              <label for="priorite2" class="form-label">Priorité sur les Appels</label>
              <select class="form-select" id="priorite2" aria-label="Default select example" formControlName="appel">
                <option selected>Selectionner la priorité</option>
                <option value="0">0</option>
                <option value="1">1</option>
                <option value="2">2</option>
                <option value="3">3</option>
              </select>
            </div>
            <div class="mb-3">
              <label for="priorite3" class="form-label">Priorité sur les Megas</label>
              <select class="form-select" id="priorite3" aria-label="Default select example" formControlName="data">
                <option selected>Selectionner la priorité</option>
                <option value="0">0</option>
                <option value="1">1</option>
                <option value="2">2</option>
                <option value="3">3</option>
              </select>
            </div>
            <div class="mb-3">
              <button class="btn btn-log d-grid w-100" type="submit" >Valider</button>
            </div>
          </form>
        </div>
      </div>

    </div>
  </div>
</div>

<!-- / Content -->
